fill(Circle((-20,0),20),white);
fill(Circle((20,0),20),white);
draw((-40,20)--(40,20)--(40,-20)--(-40,-20)--cycle);
draw(Circle((-20,0),20));
draw(Circle((20,0),20));

[/asy] The final Answer is 8-2\pi
 ### Proof
 Each diameter of a circle is 2 units. The rectangle is 2 diameters by 1 diameter, or 4 units by 2 units. Its area is thus 8 square units. Each circle has an area of $1^2\pi=\pi$ square units, so the two circles have a combined area of $2\pi$ square units.
 The total shaded area is that of the rectangle minus that of the excluded circles, or $\boxed{8-2\pi}$ square units.
 *)

theorem
fixes r :: real and A_rect A_circ :: "real \<Rightarrow> real"
assumes h0 : "r = 1"
and h1 : "\<forall> a b. A_rect a b = a * b"
and h2 : "\<forall> r. A_circ r = pi * r^2"
and h3 : "A_rect 4 2 = 2 * A_circ r"
shows  "A_rect 4 2 - 2 * A_circ r = 8 - 2 * pi"
 proof- 
  show ?thesis sledgehammer

